import React, { useState, useEffect } from 'react';

const AllPlayersPicksPage = () => {
  const [selectedWeek, setSelectedWeek] = useState('current');
  const [picksData, setPicksData] = useState([]);
  const [winnersData, setWinnersData] = useState([]);
  const [totalsData, setTotalsData] = useState({});
  const maxWeekPlayed = 3; // Example: We’ve played 3 weeks

  useEffect(() => {
    if (selectedWeek === 'current') {
      fetch('http://localhost:4000/data/picks.json')
        .then(res => res.json())
        .then(data => setPicksData(data))
        .catch(() => setPicksData([]));
      setWinnersData([]);
    } else {
      fetch(`http://localhost:4000/data/picks_week_${selectedWeek}.json`)
        .then(res => res.json())
        .then(data => setPicksData(data))
        .catch(() => setPicksData([]));

      fetch(`http://localhost:4000/data/winners_week_${selectedWeek}.json`)
        .then(res => res.json())
        .then(data => setWinnersData(data))
        .catch(() => setWinnersData([]));

      fetch(`http://localhost:4000/data/totals.json`)
        .then(res => res.json())
        .then(data => setTotalsData(data))
        .catch(() => setTotalsData({}));
    }
  }, [selectedWeek]);

  const renderWeekOptions = () => {
    const weeks = [];
    weeks.push(<option key="current" value="current">Current Week</option>);
    for (let i = 1; i <= maxWeekPlayed; i++) {
      weeks.push(<option key={`week${i}`} value={i}>Week {i}</option>);
    }
    return weeks;
  };

  const getWinningPicksString = (entry) => {
    if (!winnersData.length) return 'No data available';
    const playerWinners = winnersData.find(w => w.player === entry.player);
    return playerWinners ? playerWinners.winningPicks.join(', ') : 'No data available';
  };

  const getWeeklyScore = (entry) => {
    if (!winnersData.length) return 'NA';
    const playerWinners = winnersData.find(w => w.player === entry.player);
    return playerWinners ? `${playerWinners.score}/10` : 'NA';
  };

  const getTotalScore = (entry) => {
    if (!totalsData[entry.player]) return 'NA';
    return totalsData[entry.player];
  };

  return (
    <div style={{ padding: '30px', maxWidth: '1000px', margin: 'auto', fontFamily: 'Arial, sans-serif' }}>
      <h2>All Players' Picks Page</h2>

      <p style={{ marginBottom: '20px' }}>
        Here are your picks, your winners, your week total points, and your overall points.
        Choose a week if you'd like to view your history.
        <br />
        <strong>Current week data will be incomplete until the scores have been added.</strong>
      </p>

      <label style={{ fontWeight: 'bold', marginRight: '10px' }}>Week:</label>
      <select value={selectedWeek} onChange={(e) => setSelectedWeek(e.target.value)} style={{ padding: '5px' }}>
        {renderWeekOptions()}
      </select>

      <table style={{ marginTop: '20px', width: '100%', borderCollapse: 'collapse' }}>
        <thead>
          <tr style={{ borderBottom: '2px solid black' }}>
            <th>Player</th>
            <th>Picks</th>
            <th>Winning Picks</th>
            <th>Weekly Score</th>
            <th>Total Score</th>
          </tr>
        </thead>
        <tbody>
          {picksData.map((entry, index) => (
            <tr key={index} style={{ borderBottom: '1px solid #ccc' }}>
              <td>{entry.player}</td>
              <td>{entry.picks.join(', ')}</td>
              <td>{selectedWeek === 'current' ? 'No data available' : getWinningPicksString(entry)}</td>
              <td>{selectedWeek === 'current' ? 'NA' : getWeeklyScore(entry)}</td>
              <td>{selectedWeek === 'current' ? 'NA' : getTotalScore(entry)}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default AllPlayersPicksPage;
